script: |
  super -f text -I q6135.spq | sort > q6135.out

inputs:
  - name: q6135.spq
    data: |
      SELECT - 5 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT ( - col2 + - col1 ) BETWEEN - ( - 9 ) + col1 AND ( NULL );
  - name: tab2

outputs:
  - name: q6135.out
    data: |
      -5
      -5
      -5
